import { useState } from "react";
import { useAuth0 } from "@auth0/auth0-react";
import { Link } from "react-router-dom";
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import { NavBar } from "../components/sections/navBar.js";
import { Footer } from "../components/sections/footer.js";



export const Login = () => {
  const { loginWithRedirect } = useAuth0();
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();

    console.log(email, password);
  };

  return (
    <form className="logIn" onSubmit={handleSubmit} action="http://localhost:5000">
        <NavBar />
      <h3>Log In</h3>

      <label>Email:</label>
      <input
        type="email"
        onChange={(e) => setEmail(e.target.value)}
        value={email}
      />

      <label>Password:</label>
      <input
        type="password"
        onChange={(e) => setPassword(e.target.value)}
        value={password}
      />

      {/* <button>Sign up</button>

      <div className="headerItems">
        <Link className="menuItem" to="/signUp">
          SignUp
        </Link>
      </div> */}
        <button type="submit" className="google-button">SignUp</button>

        <Footer />
    </form>
    
    

  );
  
};
